import { findByLabelText } from "@testing-library/react";
import { NavLink } from "react-router-dom";

const Footer = () => {
  return (
    <nav className="flex gap-4 font-mono bg-[#D3D0CBFF] text-[#964F4CFF] h-11 text-2xl px-5 py-1 ">
      <NavLink to="/" className="underline font-bold">
        Home
      </NavLink>
      <NavLink to="about" className="underline font-bold">
        About
      </NavLink>
      <NavLink to="projects" className="underline font-bold">
        Projects
      </NavLink>
      <NavLink to="contact" className="underline font-bold">
        Contact
      </NavLink>
    </nav>
  );
};
export default Footer;
